import styled from "styled-components";

export const InputPokemon = styled.input` 

    width: 100%;
    height: 40%;
    display: flex;
    border: 2px solid #000000;
    border-radius: 9px;
    font-size: 100%;
    text-indent: 10px;
    box-sizing: border-box;
    outline: 0;
`;

export const Container = styled.div`
    display: flex;
    width: 50%;
    height: 20%;
`;
